    false,nt"url": null,nt"notes": "This annual narrative report for Ouray
    National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and vegetation control, prescribed burning,
    and wildfires. Resource management is outlined; topics include grazing and timber
    removal. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, violations, and safety. N-R forms
    and newspaper articles are attached.",nt"license_title": "License Not Specified",nt"extras":
